import Contact from "./components/contact.js";
import Frontview from "./components/up";
import Projects from "./components/project";
import img from "./components/photu.jpg"
export default function App() {
  let s = "</>";
  return (
    <div>
      <div
        className="bg-fixed brightness-50 hover:brightness-100"
        style={{
          backgroundImage: "url(https://cdn.wallpapersafari.com/2/99/CKgrVs.jpg"
        }}
      >

        <div className="grid lg:grid-cols-3 sm-grid-cols-2 gap-1">
        <div classname=" border-solid ">
        <img
          className="object-cover h-20 border-double rounded-full hover:drop-shadow-2xl"
          //src="https://www.dictionary.com/e/wp-content/uploads/2018/04/Sasuke.jpg"
          src={img}
          alt=""
        />
      </div>
        <h1 className="text-sky-300 lg:text-4xl font-bold tracking-wider text-center hover:text-red-300 hover:tracking-widest">

          Hello Jayant <en>Here</en>
          {s}
        </h1>
        </div>
        <br />
        <Frontview />
      </div>
      <br />
      <div
        className="brigthness-50 hover:brightness-100 bg-fix"
        style={{
          backgroundImage:
            "url(data:image/jpeg;base64,)"
        }}
      >
        <Projects />
      </div>
      <br />
      <div className="bg-black">
        <Contact />
      </div>
    </div>
  );
}
